import React, { useState } from "react";
import Avatar from "@material-ui/core/Avatar";
import Button from "@material-ui/core/Button";
import CssBaseline from "@material-ui/core/CssBaseline";
import TextField from "@material-ui/core/TextField";
import Select from "@material-ui/core/Select";
import FormControl from "@material-ui/core/FormControl";
import InputLabel from "@material-ui/core/InputLabel";
import MenuItem from "@material-ui/core/MenuItem";
import Box from "@material-ui/core/Box";
import Link from "@material-ui/core/Link";
import Grid from "@material-ui/core/Grid";
import LockOutlinedIcon from "@material-ui/icons/LockOutlined";
import Typography from "@material-ui/core/Typography";
import { makeStyles } from "@material-ui/core/styles";
import Container from "@material-ui/core/Container";
import Api from "../../../../../util/Api";
import swal from "sweetalert";
import { Link as Link_NAV } from "react-router-dom";
import Error from "../../../../../components/alerts/Error";
import HelperTexts from "../../../../../components/HelperTexts";
import { authenticate } from "../../../../../util/auth";
import Card from "@material-ui/core/Card";
import CardActionArea from "@material-ui/core/CardActionArea";
import CardActions from "@material-ui/core/CardActions";
import CardContent from "@material-ui/core/CardContent";
import CardMedia from "@material-ui/core/CardMedia";

const useStyles = makeStyles((theme) => ({}));

export default function Index({ handleForm, errors }) {
  const classes = useStyles();

  return (
    <>
      <Typography variant="h6" color="textSecondary" gutterBottom>
        <strong>Innovation details</strong>
      </Typography>

      <CardActionArea>
        <CardMedia
          component="img"
          alt="Innovation"
          height="200"
          width="200"
          image="/static/images/innovation.jpg"
          title="Innovation"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="h2">
            What we look for?
          </Typography>
          <Typography variant="body2" color="textSecondary" component="p">
            Innovation is the practical implementation of ideas that result in
            the introduction of new goods or services or improvement in offering
            goods or services.[1] ISO TC 279 on innovation management proposes
            in the standards, ISO 56000:2020 [2] to define innovation as "a new
            or changed entity creating or redistributing value". However, many
            scholars and governmental organizations have given their own
            definition of the concept. Some common element in the different
            definitions is a focus on newness, improvement and spread. It is
            also often viewed as taking place through the provision of
            more-effective products, processes, services, technologies, art
            works[3] or business models that innovators make available to
            markets, governments and society. Innovation is related to, but not
            the same as, invention:
          </Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
        <Button size="small" color="primary">
          Share
        </Button>
        <Button size="small" color="primary">
          Learn More
        </Button>
      </CardActions>

      <Grid container spacing={1}>
        <Grid item xs={12}></Grid>
      </Grid>
    </>
  );
}
